INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40000, 0, 100, 0, "", 91002, 0, 1, 36, 8, "");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40001, 107501, 150, 0, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 91002, 1, 1, 37, 8, "ぺコリーヌ");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40001, 107601, 150, 0, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 91002, 1, 2, 38, 8, "コッコロ");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40001, 107801, 150, 0, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 91002, 1, 3, 39, 8, "キャル");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40001, 107701, 150, 0, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 91002, 1, 4, 40, 8, "スズメ");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40001, 107901, 150, 0, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 91002, 1, 5, 41, 8, "タマキ");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40001, 107501, 150, 0, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 91002, 2, 6, 42, 8, "ぺコリーヌ");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40001, 107601, 150, 0, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 91002, 2, 7, 43, 8, "コッコロ");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40001, 107801, 150, 0, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 91002, 2, 8, 44, 8, "キャル");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40001, 107701, 150, 0, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 91002, 2, 9, 45, 8, "スズメ");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40001, 107901, 150, 0, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 91002, 2, 10, 46, 8, "タマキ");
