INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40011, 125801, 1, 0, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 24001, 1, 1, 321, 2, "リリ");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40011, 126001, 1, 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 24001, 1, 2, 322, 2, "クリア");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40011, 126101, 1, 0, "んーと。\nこれ、あげる。\nはい", 24001, 1, 3, 323, 2, "プレシア");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40011, 125801, 1, 0, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 24001, 2, 4, 324, 2, "リリ");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40011, 126001, 1, 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 2, 5, 325, 2, "クリア");
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (40011, 126101, 1, 0, "お兄。\nきてくれて、うれしい", 24001, 2, 6, 326, 2, "プレシア");
